import React from "react";
import { proy } from "./constantes";
import { tar } from "./constantes";
import { usr } from "./constantes";
import ReactDOM from "react-dom/client";

export function menuproyectos() {
    const mensec = document.getElementById("mensec");
    ReactDOM.render(proy, mensec);
}

export function menutar() {
    const mensec = document.getElementById("mensec");
    ReactDOM.render(tar, mensec);
}

export function menuusuarios() {
    const mensec = document.getElementById("mensec");
    ReactDOM.render(usr, mensec);
}
